  input: 'TEXT,F3XA,,"BUILD PAC is committed to properly disclosing all information
    in a precise and timely manner.  To adhere to that commitment, this amended report
    is a response to a letter dated February 15, 2002 from Antoinette Kitchen, FEC
    Reports Analysis Division.  In this letter, Ms. Kitchen raised three issues.  To
    address the first issue: Bank of America and American Express charge fees for
    processing contributions that are made by credit card.  These fees were incorrectly
    disclosed on Line (21)(a)(ii).  At the direction of Antoinette Kitchen on February
    22, 2002, these fees are being moved to line 21(b) to accurately reflect the nature
    of these expenses.  The second issue: This also clarifies that these payments
    were made direclty to these credit card companies to cover the cost of credit
    card transactions and not ''to purchase an item or service'' from an outside vendor.
    The last issue: Contributions made to ''Adam Schiff for Congress'' and ''Citizens
    to Elect Rick Larsen'' have been accurately attributed to Debt Retirement for
    the General Election 2000."'
